wp = WiktionaryParser()
pqual = re.compile(r' ?\(.+?\)| ?\[.+?\]| ?[\.\:]\s*$')
pos2abr = {'noun':'N', 'verb': 'V', 'adverb':'ADV', 'determiner':'DET',
    'article':'ART', 'preposition':'PREP', 'conjunction':'CONJ', 'proper noun':'PN',
    'letter':'LET', 'character':'CHAR', 'phrase':'PHR', 'proverb':'PV', 'idiom':'ID',
    'symbol':'SYM', 'syllable':'SYL', 'numeral':'NUM', 'initialism':'INIT', 'interjection':'INT',
    'definitions':'DEF', 'pronoun':'PN', 'particle':'PTC', 'predicative':'PRED', 'participle':'PCP',
    'suffix':'SFX'}
def lencap(iter_):
    n = 80
    for x in iter_:
        n -= len(x)
        if n < 0:
            break
        yield x
def get_entry(word: str):
    try:
        defs = list(chain.from_iterable(entry['definitions'] for entry in wp.fetch(word, 'English')))
        if meaning := '; '.join(lencap(' '.join(lencap(pqual.sub('', text).split())) for text in chain.from_iterable(d['text'][1:] for d in defs))):
            part = '|'.join(set(filter(None, map(pos2abr.get, (d['partOfSpeech'] for d in defs)))))
            return word, meaning, part
    except Exception as e:
        print(f'{word}: {e}')

